import React from 'react';

interface Props {
  styleTags: string[];
  spines: string[];
}

const Viewer: React.FunctionComponent<Props> = ({ styleTags, spines }) => {
  return (
    <>
      {
        styleTags.map((styleTag) => styleTag)
      }
      {
        // eslint-disable-next-line react/no-danger
        spines.map((spine) => <section dangerouslySetInnerHTML={{ __html: spine }} />)
      }
    </>
  );
};

export default Viewer;
